import ReactDOM from 'react-dom/client'; // Importa createRoot
import App from './App';
import './index.css'; // Tu archivo de estilos globales

// Inicializar React 18 correctamente
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
